CREATE DATABASE `app-analysis-system`;

USE `app-analysis-system`;

-- 白名单APK
CREATE TABLE IF NOT EXISTS `whitelist`(
    `md5` VARCHAR(32) PRIMARY KEY COMMENT 'MD5',
    `appname` VARCHAR(1024) COMMENT 'APP名称',
    `packagename` VARCHAR(1024) COMMENT '包名'
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- 涉赌APK
CREATE TABLE IF NOT EXISTS `gamblelist`(
    `md5` VARCHAR(32) PRIMARY KEY COMMENT 'MD5',
    `appname` VARCHAR(1024) COMMENT 'APP名称',
    `packagename` VARCHAR(1024) COMMENT '包名'
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- 涉黄APK
CREATE TABLE IF NOT EXISTS `sexlist`(
    `md5` VARCHAR(32) PRIMARY KEY COMMENT 'MD5',
    `appname` VARCHAR(1024) COMMENT 'APP名称',
    `packagename` VARCHAR(1024) COMMENT '包名'
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- 涉诈APK
CREATE TABLE IF NOT EXISTS `scamlist`(
    `md5` VARCHAR(32) PRIMARY KEY COMMENT 'MD5',
    `appname` VARCHAR(1024) COMMENT 'APP名称',
    `packagename` VARCHAR(1024) COMMENT '包名'
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- 黑灰产APK
CREATE TABLE IF NOT EXISTS `blacklist`(
    `md5` VARCHAR(32) PRIMARY KEY COMMENT 'MD5',
    `appname` VARCHAR(1024) COMMENT 'APP名称',
    `packagename` VARCHAR(1024) COMMENT '包名'
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- 权限列表
CREATE TABLE IF NOT EXISTS `permission`(
    `name` VARCHAR(50) PRIMARY KEY COMMENT '名称',
    `description` VARCHAR(1024) NOT NULL COMMENT '描述',
    `level` VARCHAR(8) NOT NULL COMMENT '级别'
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;








